import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path=":teamId" element={<Team />} />
        <Route path="new" element={<NewTeamForm />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
